import React, { useState, useEffect } from "react";
import TodoItem from "./ToDoItem";



export default function ToDoList({ todos }) {
  const renderToDo = () => {
    todos.map()
  }
  return (
    <div className="todo-container">
      <ul className="todo-list"></ul>
      {renderToDo}
    </div>
  );
}
